INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24015, 1, 24, 4, 110501, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", 0.0, 4, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24016, 2, 24, 1, 110501, "カオリ（サマー）", 4.0, "2019/07/31 12:00:00", "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", 0.0, 4, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24017, 3, 24, 4, 110501, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", 0.0, 4, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24018, 4, 24, 2, 110501, "カオリ（サマー）", 5.2, "2019/07/31 12:00:00", "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", 0.0, 1, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24019, 5, 24, 6, 110501, "カオリ（サマー）", 4.2, "2019/07/31 12:00:00", "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", 0.0, 5, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24020, 6, 24, 2, 110501, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", 0.0, 2, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24021, 7, 24, 6, 110501, "カオリ（サマー）", 6.4, "2019/07/31 12:00:00", "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", 0.0, 1, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24022, 8, 24, 2, 110501, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", 0.0, 2, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24023, 9, 24, 3, 110501, "カオリ（サマー）", 10.08, "2019/07/31 12:00:00", "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", 0.0, 6, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24024, 10, 24, 2, 110501, "カオリ（サマー）", 5.0, "2019/07/31 12:00:00", "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", 0.0, 1, 10021, 0.0);
INSERT INTO `v1_df9c06cc4ab9d046b24105488c616f2557d69ab915ffe0496c9d7909f8356395` VALUES (24025, 11, 24, 2, 110501, "カオリ（サマー）", 0.0, "2019/07/31 12:00:00", "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", 0.0, 2, 10021, 0.0);
